        <i onClick={() => onDelete(value)} className="mt-2 mr-2 bg-blue-100 hover:bg-blue-200 text-blue-800 text-sm font-medium px-2.5 py-0.5 rounded dark:bg-blue-200 dark:text-blue-800 dark:hover:bg-blue-300">{value}</i>
    );
}

export default Tag;
